import React, { useState } from "react";
import "../Css/Sell.css";

function Sell() {
  const [images, setImages] = useState([]);
  const [previewImgs, setPreviewImgs] = useState([]);

  const farmerId = localStorage.getItem("farmerId"); // ⭐ Get Farmer ID

  const handleImageUpload = (e) => {
    const files = Array.from(e.target.files);

    setImages(files);

    const previews = files.map((file) => URL.createObjectURL(file));
    setPreviewImgs(previews);
  };

  const handleSubmit = async () => {
    const formData = new FormData();

    formData.append("cropName", document.getElementById("cropName").value);
    formData.append("category", document.getElementById("category").value);
    formData.append("quantity", document.getElementById("quantity").value);
    formData.append("pricePerKg", document.getElementById("pricePerKg").value);
    formData.append("deliveryTime", document.getElementById("deliveryTime").value);
    formData.append("grade", document.getElementById("grade").value);
    formData.append("description", document.getElementById("description").value);

    formData.append("farmerId", farmerId); // ⭐ ADD FARMER ID

    images.forEach((file) => {
      formData.append("images", file);
    });

    const res = await fetch("http://localhost:9090/backend/api/crop/sell", {
      method: "POST",
      body: formData,
    });

    const data = await res.json();

    if (data.status === "success") {
      alert("Crop Posted Successfully!");
    } else {
      alert("Failed: " + data.message);
    }
  };

  return (
    <div className="sell-container">

      <h2 className="sell-title">
        <i className="fa fa-store"></i> Sell Your Crops
      </h2>

      <div className="sell-layout">

        {/* IMAGE UPLOAD SECTION */}
        <div className="sell-image-box">

          <label className="upload-btn">
            <i className="fa fa-upload"></i> Upload Images
            <input type="file" multiple accept="image/*" onChange={handleImageUpload} />
          </label>

          <div className="preview-grid">
            {previewImgs.map((img, i) => (
              <img key={i} src={img} className="multi-preview" alt="preview" />
            ))}
          </div>
        </div>

        {/* FORM FIELDS */}
        <div className="sell-form">

          <label className="sell-label"><i className="fa fa-leaf"></i> Crop Name</label>
          <input id="cropName" type="text" className="sell-input" />

          <label className="sell-label"><i className="fa fa-list"></i> Category</label>
          <select id="category" className="sell-input">
            <option>Grains</option>
            <option>Vegetables</option>
            <option>Fruits</option>
            <option>Pulses</option>
            <option>Oil Seeds</option>
          </select>

          <div className="sell-row">
            <div>
              <label className="sell-label"><i className="fa fa-weight-hanging"></i> Quantity (Kg)</label>
              <input id="quantity" type="number" className="sell-input" />
            </div>

            <div>
              <label className="sell-label"><i className="fa fa-rupee-sign"></i> Price per Kg</label>
              <input id="pricePerKg" type="number" className="sell-input" />
            </div>
          </div>

          <label className="sell-label"><i className="fa fa-clock"></i> Expected Delivery</label>
          <select id="deliveryTime" className="sell-input">
            <option>1 Day</option>
            <option>2-3 Days</option>
            <option>Within a Week</option>
          </select>

          <label className="sell-label"><i className="fa fa-star"></i> Crop Grade</label>
          <select id="grade" className="sell-input">
            <option>A (Premium)</option>
            <option>B (Good)</option>
            <option>C (Average)</option>
          </select>

          <label className="sell-label"><i className="fa fa-align-left"></i> Description</label>
          <textarea id="description" className="sell-textarea"></textarea>

          <button className="sell-submit" onClick={handleSubmit}>
            <i className="fa fa-check-circle"></i> Post Crop for Sale
          </button>

        </div>
      </div>
    </div>
  );
}

export default Sell;
